  let exportData = (exportAsPdf = false) => {
    let inputsObject = Object.values(document.getElementsByTagName("input")).reduce((acc, cur) => {
      if (cur.id) {
       return {...acc, [cur.id]: cur.value};
      }
      return acc;
    }, {});
    let selectsObject = Object.values(document.getElementsByTagName("select")).reduce((acc, cur) => {
      if (cur.id) {
       let selectedOption = Array.from(cur.querySelectorAll("option")).find(o => o.hasAttribute("selected"));
       return {...acc, [cur.id]: selectedOption?.innerHTML || ""};
      }
      return acc;
    }, {});
    let dataObject = {...inputsObject, ...selectsObject};
    let fileName = `export_${dataObject.Identite_Nom}_${dataObject.Identite_Prenom}_${new Date().toLocaleString().replaceAll("/", "-")}${exportAsPdf ? ".pdf" : ".txt"}`;
    if (exportAsPdf) {
      const { jsPDF } = window.jspdf;
      const doc = new jsPDF();
      Array.from({ length: 6 }).forEach((_, index) => {
          console.log(index);
        doc.addImage(getDataString(index), 'JPEG', 0, 0, 210, 297, `cerfa_16146_03-${index}`, "NONE", 0);
        Object.keys(dataObject).forEach(key => {
          if (typeof positionTable[key] === "object" && positionTable[key][0] === index) {
            doc.text(dataObject[key], positionTable[key][1], positionTable[key][2]);
          } else if (typeof positionTable[key] === "function") {
            positionTable[key](index, dataObject[key], doc);
          }
        });
        doc.addPage();
      });
      doc.save(fileName);
    } else {
      let element = document.createElement('a');
      let dataArray = Object.keys(dataObject).map(key => `${key} : ${dataObject[key]}`);
      element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(dataArray.join("\n")));
      element.setAttribute('download', fileName);
      element.style.display = 'none';
      document.body.appendChild(element);
      element.click();
      document.body.removeChild(element);
    }
  };
